import React from 'react';
import './App.css';
import Login from './Container/Login/Login';
import Navbar from './Component/Navbar/Navbar';

function App() {
  return (

    <div className="App">
      <header>
        <Navbar />
      </header>

      <body>
        <Login />
      </body>

    </div>
  );
}

export default App;
